contracts/DeliveryGuarantee.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title DeliveryGuarantee
 * @dev Manages delivery guarantees, escrow, penalties, and SLA compliance
 */
contract DeliveryGuarantee is Ownable, ReentrancyGuard {

    enum GuaranteeStatus { ACTIVE, FULFILLED, BREACHED, DISPUTED, CANCELLED }
    enum SLAStatus { ON_TIME, AT_RISK, DELAYED, EXCEEDED_EXPECTATIONS }

    struct Guarantee {
        string guaranteeId;
        string mailId;
        uint256 guaranteedTime;
        uint256 penaltyAmount;
        uint256 insuranceAmount;
        address customer;
        address escrowAddress;
        GuaranteeStatus status;
        uint256 creationTime;
        uint256 escrowAmount;
        bytes32 contractTermsHash;
        string[] escalationContacts;
        bool requiresProofOfTime;
        uint256 actualDeliveryTime;
        bool penaltyPaid;
    }

    struct PerformanceMetrics {
        uint256 totalGuarantees;
        uint256 onTimeDeliveries;
        uint256 delayedDeliveries;
        uint256 totalPenaltiesPaid;
        uint256 averageDeliveryTime;
        uint256 customerSatisfactionScore;
    }

    struct EscrowDetails {
        uint256 amount;
        address token; // address(0) for ETH
        bool isReleased;
        uint256 releaseTime;
        address releaseAuthority;
    }

    mapping(string => Guarantee) public guarantees;
    mapping(string => EscrowDetails) public escrowDetails;
    mapping(address => string[]) public customerGuarantees;
    mapping(string => bool) public guaranteeExists;
    mapping(address => PerformanceMetrics) public performanceMetrics;
    mapping(string => SLAStatus) public slaStatus;

    string[] public allGuaranteeIds;
    uint256 public totalGuarantees;
    uint256 public totalEscrowAmount;

    // Emergency contacts for SLA breaches
    mapping(string => address[]) public emergencyContacts;

    event GuaranteeCreated(
        string indexed guaranteeId,
        string indexed mailId,
        address indexed customer,
        uint256 guaranteedTime,
        uint256 penaltyAmount,
        uint256 escrowAmount
    );

    event GuaranteeUpdated(
        string indexed guaranteeId,
        GuaranteeStatus newStatus,
        uint256 timestamp
    );

    event EscrowDeposited(
        string indexed guaranteeId,
        uint256 amount,
        address token,
        address depositor
    );

    event EscrowReleased(
        string indexed guaranteeId,
        address recipient,
        uint256 amount,
        bool isPenalty
    );

    event SLAStatusUpdated(
        string indexed mailId,
        SLAStatus newStatus,
        uint256 timestamp
    );

    event EmergencyAlertTriggered(
        string indexed guaranteeId,
        string reason,
        uint256 timestamp,
        address[] notifiedContacts
    );

    event PenaltyPaid(
        string indexed guaranteeId,
        address recipient,
        uint256 amount,
        uint256 timestamp
    );

    modifier guaranteeExistsModifier(string memory guaranteeId) {
        require(guaranteeExists[guaranteeId], "Guarantee does not exist");
        _;
    }

    modifier onlyCustomer(string memory guaranteeId) {
        require(guarantees[guaranteeId].customer == msg.sender, "Only customer can perform this action");
        _;
    }

    modifier validGuaranteeTime(uint256 guaranteedTime) {
        require(guaranteedTime > block.timestamp, "Guaranteed time must be in the future");
        _;
    }

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Estimate gas for guarantee creation (for gas estimation purposes)
     */
    function estimateGuaranteeCreation(
        string memory guaranteeId,
        string memory mailId,
        uint256 guaranteedTime,
        uint256 penaltyAmount,
        uint256 insuranceAmount,
        string[] memory escalationContacts,
        bool requiresProofOfTime,
        bytes32 contractTermsHash
    ) external view returns (uint256) {
        require(!guaranteeExists[guaranteeId], "Guarantee ID already exists");
        require(bytes(mailId).length > 0, "Mail ID cannot be empty");
        require(penaltyAmount > 0, "Penalty amount must be greater than 0");
        require(escalationContacts.length > 0, "Must provide escalation contacts");

        // This is just for gas estimation, so we don't check msg.value
        // The actual createGuarantee function will validate msg.value

        return 400000; // Base gas estimate
    }

    /**
     * @dev Create a new delivery guarantee with escrow
     */
    function createGuarantee(
        string memory guaranteeId,
        string memory mailId,
        uint256 guaranteedTime,
        uint256 penaltyAmount,
        uint256 insuranceAmount,
        string[] memory escalationContacts,
        bool requiresProofOfTime,
        bytes32 contractTermsHash
    ) external payable validGuaranteeTime(guaranteedTime) nonReentrant {
        require(!guaranteeExists[guaranteeId], "Guarantee ID already exists");
        require(bytes(mailId).length > 0, "Mail ID cannot be empty");
        require(penaltyAmount > 0, "Penalty amount must be greater than 0");
        require(msg.value >= penaltyAmount, "Insufficient escrow amount");
        require(escalationContacts.length > 0, "Must provide escalation contacts");

        // Additional validation: ensure the mail exists in MailRegistry
        // This prevents creating guarantees for non-existent mails
        // Note: We'll need to add a way to validate this

        Guarantee memory guarantee = Guarantee({
            guaranteeId: guaranteeId,
            mailId: mailId,
            guaranteedTime: guaranteedTime,
            penaltyAmount: penaltyAmount,
            insuranceAmount: insuranceAmount,
            customer: msg.sender,
            escrowAddress: address(this),
            status: GuaranteeStatus.ACTIVE,
            creationTime: block.timestamp,
            escrowAmount: msg.value,
            contractTermsHash: contractTermsHash,
            escalationContacts: escalationContacts,
            requiresProofOfTime: requiresProofOfTime,
            actualDeliveryTime: 0,
            penaltyPaid: false
        });

        guarantees[guaranteeId] = guarantee;
        guaranteeExists[guaranteeId] = true;
        customerGuarantees[msg.sender].push(guaranteeId);
        allGuaranteeIds.push(guaranteeId);
        totalGuarantees++;
        totalEscrowAmount += msg.value;

        escrowDetails[guaranteeId] = EscrowDetails({
            amount: msg.value,
            token: address(0), // ETH
            isReleased: false,
            releaseTime: 0,
            releaseAuthority: owner()
        });

        slaStatus[mailId] = SLAStatus.ON_TIME;

        emit GuaranteeCreated(
            guaranteeId,
            mailId,
            msg.sender,
            guaranteedTime,
            penaltyAmount,
            msg.value
        );

        emit EscrowDeposited(guaranteeId, msg.value, address(0), msg.sender);
    }

    /**
     * @dev Update guarantee status when delivery is completed
     */
    function updateGuaranteeStatus(
        string memory guaranteeId,
        uint256 actualDeliveryTime,
        bool wasDeliveredOnTime
    ) external onlyOwner guaranteeExistsModifier(guaranteeId) {
        Guarantee storage guarantee = guarantees[guaranteeId];
        require(guarantee.status == GuaranteeStatus.ACTIVE, "Guarantee not active");

        guarantee.actualDeliveryTime = actualDeliveryTime;

        if (wasDeliveredOnTime) {
            guarantee.status = GuaranteeStatus.FULFILLED;
            slaStatus[guarantee.mailId] = actualDeliveryTime < guarantee.guaranteedTime - 3600 ? 
                SLAStatus.EXCEEDED_EXPECTATIONS : SLAStatus.ON_TIME;

            // Release escrow back to customer
            _releaseEscrow(guaranteeId, guarantee.customer, false);

            // Update performance metrics
            performanceMetrics[address(this)].onTimeDeliveries++;
        } else {
            guarantee.status = GuaranteeStatus.BREACHED;
            slaStatus[guarantee.mailId] = SLAStatus.DELAYED;

            // Pay penalty to customer
            _payPenalty(guaranteeId);

            // Update performance metrics
            performanceMetrics[address(this)].delayedDeliveries++;
            performanceMetrics[address(this)].totalPenaltiesPaid += guarantee.penaltyAmount;
        }

        performanceMetrics[address(this)].totalGuarantees++;

        emit GuaranteeUpdated(guaranteeId, guarantee.status, block.timestamp);
        emit SLAStatusUpdated(guarantee.mailId, slaStatus[guarantee.mailId], block.timestamp);
    }

    /**
     * @dev Monitor SLA status and trigger alerts
     */
    function monitorSLA(string memory mailId, uint256 currentTime) external {
        // Find guarantee for this mail
        string memory guaranteeId = "";
        for (uint256 i = 0; i < allGuaranteeIds.length; i++) {
            if (keccak256(bytes(guarantees[allGuaranteeIds[i]].mailId)) == keccak256(bytes(mailId))) {
                guaranteeId = allGuaranteeIds[i];
                break;
            }
        }

        require(bytes(guaranteeId).length > 0, "No guarantee found for this mail");

        Guarantee storage guarantee = guarantees[guaranteeId];
        require(guarantee.status == GuaranteeStatus.ACTIVE, "Guarantee not active");

        uint256 timeRemaining = guarantee.guaranteedTime > currentTime ? 
            guarantee.guaranteedTime - currentTime : 0;

        SLAStatus newStatus;
        if (timeRemaining == 0) {
            newStatus = SLAStatus.DELAYED;
        } else if (timeRemaining <= 7200) { // 2 hours warning
            newStatus = SLAStatus.AT_RISK;
        } else {
            newStatus = SLAStatus.ON_TIME;
        }

        if (newStatus != slaStatus[mailId]) {
            slaStatus[mailId] = newStatus;
            emit SLAStatusUpdated(mailId, newStatus, block.timestamp);

            // Trigger emergency alert if at risk or delayed
            if (newStatus == SLAStatus.AT_RISK || newStatus == SLAStatus.DELAYED) {
                _triggerEmergencyAlert(guaranteeId, "SLA at risk or breached");
            }
        }
    }

    /**
     * @dev Get guarantee details
     */
    function getGuarantee(string memory guaranteeId) external view guaranteeExistsModifier(guaranteeId) returns (
        string memory mailId,
        uint256 guaranteedTime,
        uint256 penaltyAmount,
        address customer,
        GuaranteeStatus status,
        uint256 creationTime,
        uint256 actualDeliveryTime,
        bool penaltyPaid
    ) {
        Guarantee memory guarantee = guarantees[guaranteeId];
        return (
            guarantee.mailId,
            guarantee.guaranteedTime,
            guarantee.penaltyAmount,
            guarantee.customer,
            guarantee.status,
            guarantee.creationTime,
            guarantee.actualDeliveryTime,
            guarantee.penaltyPaid
        );
    }

    /**
     * @dev Get delivery performance metrics
     */
    function getDeliveryPerformance(string memory mailId) external view returns (
        uint256 guaranteedTime,
        uint256 actualDeliveryTime,
        SLAStatus slaCompliance,
        bool deliveredOnTime,
        uint256 timeAheadOrBehind
    ) {
        string memory guaranteeId = "";
        for (uint256 i = 0; i < allGuaranteeIds.length; i++) {
            if (keccak256(bytes(guarantees[allGuaranteeIds[i]].mailId)) == keccak256(bytes(mailId))) {
                guaranteeId = allGuaranteeIds[i];
                break;
            }
        }

        require(bytes(guaranteeId).length > 0, "No guarantee found for this mail");

        Guarantee memory guarantee = guarantees[guaranteeId];
        bool onTime = guarantee.actualDeliveryTime > 0 && 
                     guarantee.actualDeliveryTime <= guarantee.guaranteedTime;

        uint256 timeDiff = 0;
        if (guarantee.actualDeliveryTime > 0) {
            timeDiff = guarantee.actualDeliveryTime > guarantee.guaranteedTime ?
                guarantee.actualDeliveryTime - guarantee.guaranteedTime :
                guarantee.guaranteedTime - guarantee.actualDeliveryTime;
        }

        return (
            guarantee.guaranteedTime,
            guarantee.actualDeliveryTime,
            slaStatus[mailId],
            onTime,
            timeDiff
        );
    }

    /**
     * @dev Get customer guarantees
     */
    function getCustomerGuarantees(address customer) external view returns (string[] memory) {
        return customerGuarantees[customer];
    }

    /**
     * @dev Get escrow details
     */
    function getEscrowDetails(string memory guaranteeId) external view guaranteeExistsModifier(guaranteeId) returns (
        uint256 amount,
        address token,
        bool isReleased,
        uint256 releaseTime,
        address releaseAuthority
    ) {
        EscrowDetails memory escrow = escrowDetails[guaranteeId];
        return (
            escrow.amount,
            escrow.token,
            escrow.isReleased,
            escrow.releaseTime,
            escrow.releaseAuthority
        );
    }

    /**
     * @dev Cancel guarantee (only customer, before delivery)
     */
    function cancelGuarantee(string memory guaranteeId) external guaranteeExistsModifier(guaranteeId) onlyCustomer(guaranteeId) {
        Guarantee storage guarantee = guarantees[guaranteeId];
        require(guarantee.status == GuaranteeStatus.ACTIVE, "Guarantee not active");
        require(guarantee.actualDeliveryTime == 0, "Cannot cancel after delivery");

        guarantee.status = GuaranteeStatus.CANCELLED;

        // Release escrow back to customer
        _releaseEscrow(guaranteeId, guarantee.customer, false);

        emit GuaranteeUpdated(guaranteeId, GuaranteeStatus.CANCELLED, block.timestamp);
    }

    /**
     * @dev Dispute guarantee
     */
    function disputeGuarantee(string memory guaranteeId, string memory reason) external guaranteeExistsModifier(guaranteeId) {
        Guarantee storage guarantee = guarantees[guaranteeId];
        require(guarantee.customer == msg.sender || msg.sender == owner(), "Not authorized to dispute");
        require(guarantee.status == GuaranteeStatus.BREACHED || guarantee.status == GuaranteeStatus.FULFILLED, 
                "Invalid status for dispute");

        guarantee.status = GuaranteeStatus.DISPUTED;

        _triggerEmergencyAlert(guaranteeId, reason);

        emit GuaranteeUpdated(guaranteeId, GuaranteeStatus.DISPUTED, block.timestamp);
    }

    /**
     * @dev Internal function to release escrow
     */
    function _releaseEscrow(string memory guaranteeId, address recipient, bool isPenalty) internal {
        EscrowDetails storage escrow = escrowDetails[guaranteeId];
        require(!escrow.isReleased, "Escrow already released");

        escrow.isReleased = true;
        escrow.releaseTime = block.timestamp;

        uint256 amount = escrow.amount;
        totalEscrowAmount -= amount;

        (bool success, ) = payable(recipient).call{value: amount}("");
        require(success, "Escrow release failed");

        emit EscrowReleased(guaranteeId, recipient, amount, isPenalty);
    }

    /**
     * @dev Internal function to pay penalty
     */
    function _payPenalty(string memory guaranteeId) internal {
        Guarantee storage guarantee = guarantees[guaranteeId];
        require(!guarantee.penaltyPaid, "Penalty already paid");

        guarantee.penaltyPaid = true;

        // Release full escrow amount as penalty to customer
        _releaseEscrow(guaranteeId, guarantee.customer, true);

        emit PenaltyPaid(guaranteeId, guarantee.customer, guarantee.penaltyAmount, block.timestamp);
    }

    /**
     * @dev Internal function to trigger emergency alert
     */
    function _triggerEmergencyAlert(string memory guaranteeId, string memory reason) internal {
        Guarantee memory guarantee = guarantees[guaranteeId];

        // Convert string array to address array (simplified for demo)
        address[] memory contacts = new address[](1);
        contacts[0] = guarantee.customer;

        emit EmergencyAlertTriggered(guaranteeId, reason, block.timestamp, contacts);
    }

    /**
     * @dev Get performance metrics
     */
    function getPerformanceMetrics() external view returns (
        uint256 total,
        uint256 onTimeDeliveries,
        uint256 delayedDeliveries,
        uint256 totalPenaltiesPaid,
        uint256 successRate
    ) {
        PerformanceMetrics memory metrics = performanceMetrics[address(this)];
        uint256 rate = metrics.totalGuarantees > 0 ? 
            (metrics.onTimeDeliveries * 100) / metrics.totalGuarantees : 0;

        return (
            metrics.totalGuarantees,
            metrics.onTimeDeliveries,
            metrics.delayedDeliveries,
            metrics.totalPenaltiesPaid,
            rate
        );
    }

    /**
     * @dev Emergency withdrawal (owner only)
     */
    function emergencyWithdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");

        (bool success, ) = payable(owner()).call{value: balance}("");
        require(success, "Withdrawal failed");
    }
}

contracts/DeliveryTracking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title DeliveryTracking
 * @dev Manages delivery status updates, worker tracking, and location data
 */
contract DeliveryTracking is Ownable, ReentrancyGuard {

    enum DeliveryStatus { 
        REGISTERED, 
        COLLECTED, 
        IN_TRANSIT, 
        OUT_FOR_DELIVERY, 
        DELIVERED, 
        EXCEPTION 
    }

    struct Coordinates {
        int256 latitude;  // Multiplied by 1e6 for precision
        int256 longitude; // Multiplied by 1e6 for precision
    }

    struct ProofOfTime {
        string ntpServer;
        uint256 atomicTime;
        string timezone;
    }

    struct StatusUpdate {
        string trackingNumber;
        address workerAddress;
        string location;
        Coordinates coordinates;
        DeliveryStatus status;
        uint256 timestamp;
        bytes signature;
        ProofOfTime proofOfTime;
        uint256 blockNumber;
        bytes32 timeProofHash;
    }

    struct Worker {
        bool isAuthorized;
        string name;
        string role;
        uint256 registrationTime;
        uint256 totalUpdates;
    }

    mapping(string => StatusUpdate[]) public trackingHistory;
    mapping(string => DeliveryStatus) public currentStatus;
    mapping(address => Worker) public workers;
    mapping(string => uint256) public lastUpdateTime;
    mapping(string => address) public lastUpdatedBy;

    address[] public authorizedWorkers;

    event WorkerRegistered(address indexed workerAddress, string name, string role, uint256 timestamp);
    event WorkerDeauthorized(address indexed workerAddress, uint256 timestamp);
    event StatusUpdated(
        string indexed trackingNumber,
        address indexed workerAddress,
        DeliveryStatus status,
        string location,
        uint256 timestamp,
        bytes32 timeProofHash
    );
    event LocationUpdated(
        string indexed trackingNumber,
        int256 latitude,
        int256 longitude,
        uint256 timestamp
    );
    event EmergencyAlert(
        string indexed trackingNumber,
        string reason,
        uint256 timestamp,
        address alertedBy
    );

    modifier onlyAuthorizedWorker() {
        require(workers[msg.sender].isAuthorized, "Not an authorized worker");
        _;
    }

    modifier validTrackingNumber(string memory trackingNumber) {
        require(bytes(trackingNumber).length > 0, "Invalid tracking number");
        _;
    }

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Register a new authorized worker
     */
    function registerWorker(
        address workerAddress,
        string memory name,
        string memory role
    ) external onlyOwner {
        require(workerAddress != address(0), "Invalid worker address");
        require(!workers[workerAddress].isAuthorized, "Worker already registered");
        require(bytes(name).length > 0, "Name cannot be empty");
        require(bytes(role).length > 0, "Role cannot be empty");

        workers[workerAddress] = Worker({
            isAuthorized: true,
            name: name,
            role: role,
            registrationTime: block.timestamp,
            totalUpdates: 0
        });

        authorizedWorkers.push(workerAddress);

        emit WorkerRegistered(workerAddress, name, role, block.timestamp);
    }

    /**
     * @dev Deauthorize a worker
     */
    function deauthorizeWorker(address workerAddress) external onlyOwner {
        require(workers[workerAddress].isAuthorized, "Worker not authorized");

        workers[workerAddress].isAuthorized = false;

        emit WorkerDeauthorized(workerAddress, block.timestamp);
    }

    /**
     * @dev Update delivery status with location and proof of time
     */
    function updateStatus(
        string memory trackingNumber,
        string memory location,
        Coordinates memory coordinates,
        DeliveryStatus status,
        bytes memory signature,
        ProofOfTime memory proofOfTime
    ) external onlyAuthorizedWorker validTrackingNumber(trackingNumber) nonReentrant {
        require(bytes(location).length > 0, "Location cannot be empty");
        require(coordinates.latitude >= -90000000 && coordinates.latitude <= 90000000, "Invalid latitude");
        require(coordinates.longitude >= -180000000 && coordinates.longitude <= 180000000, "Invalid longitude");

        // Generate time proof hash
        bytes32 timeProofHash = keccak256(abi.encodePacked(
            trackingNumber,
            msg.sender,
            location,
            coordinates.latitude,
            coordinates.longitude,
            uint256(status),
            block.timestamp,
            block.number,
            proofOfTime.ntpServer,
            proofOfTime.atomicTime
        ));

        StatusUpdate memory update = StatusUpdate({
            trackingNumber: trackingNumber,
            workerAddress: msg.sender,
            location: location,
            coordinates: coordinates,
            status: status,
            timestamp: block.timestamp,
            signature: signature,
            proofOfTime: proofOfTime,
            blockNumber: block.number,
            timeProofHash: timeProofHash
        });

        trackingHistory[trackingNumber].push(update);
        currentStatus[trackingNumber] = status;
        lastUpdateTime[trackingNumber] = block.timestamp;
        lastUpdatedBy[trackingNumber] = msg.sender;

        workers[msg.sender].totalUpdates++;

        emit StatusUpdated(
            trackingNumber,
            msg.sender,
            status,
            location,
            block.timestamp,
            timeProofHash
        );

        emit LocationUpdated(
            trackingNumber,
            coordinates.latitude,
            coordinates.longitude,
            block.timestamp
        );
    }

    /**
     * @dev Get complete tracking history for a package
     */
    function getTrackingHistory(string memory trackingNumber) 
        external 
        view 
        validTrackingNumber(trackingNumber) 
        returns (StatusUpdate[] memory) 
    {
        return trackingHistory[trackingNumber];
    }

    /**
     * @dev Get current status of a package
     */
    function getCurrentStatus(string memory trackingNumber) 
        external 
        view 
        validTrackingNumber(trackingNumber) 
        returns (
            DeliveryStatus status,
            string memory location,
            Coordinates memory coordinates,
            uint256 lastUpdate,
            address lastUpdatedByAddr
        ) 
    {
        StatusUpdate[] memory history = trackingHistory[trackingNumber];
        require(history.length > 0, "No tracking history found");

        StatusUpdate memory latestUpdate = history[history.length - 1];

        return (
            currentStatus[trackingNumber],
            latestUpdate.location,
            latestUpdate.coordinates,
            lastUpdateTime[trackingNumber],
            lastUpdatedBy[trackingNumber]
        );
    }

    /**
     * @dev Get worker information
     */
    function getWorkerInfo(address workerAddress) external view returns (
        bool isAuthorized,
        string memory name,
        string memory role,
        uint256 registrationTime,
        uint256 totalUpdates
    ) {
        Worker memory worker = workers[workerAddress];
        return (
            worker.isAuthorized,
            worker.name,
            worker.role,
            worker.registrationTime,
            worker.totalUpdates
        );
    }

    /**
     * @dev Get delivery performance metrics
     */
    function getDeliveryPerformance(string memory trackingNumber) 
        external 
        view 
        validTrackingNumber(trackingNumber) 
        returns (
            uint256 totalMilestones,
            uint256 registrationTime,
            uint256 lastUpdateTimestamp,
            bool isDelivered,
            uint256 totalTransitTime
        ) 
    {
        StatusUpdate[] memory history = trackingHistory[trackingNumber];
        require(history.length > 0, "No tracking history found");

        bool delivered = currentStatus[trackingNumber] == DeliveryStatus.DELIVERED;
        uint256 transitTime = 0;

        if (delivered) {
            transitTime = history[history.length - 1].timestamp - history[0].timestamp;
        }

        return (
            history.length,
            history[0].timestamp,
            history[history.length - 1].timestamp,
            delivered,
            transitTime
        );
    }

    /**
     * @dev Get bulk status for multiple tracking numbers
     */
    function getBulkStatus(string[] memory trackingNumbers) 
        external 
        view 
        returns (
            DeliveryStatus[] memory statuses,
            uint256[] memory lastUpdates,
            string[] memory locations
        ) 
    {
        uint256 length = trackingNumbers.length;
        statuses = new DeliveryStatus[](length);
        lastUpdates = new uint256[](length);
        locations = new string[](length);

        for (uint256 i = 0; i < length; i++) {
            if (trackingHistory[trackingNumbers[i]].length > 0) {
                statuses[i] = currentStatus[trackingNumbers[i]];
                lastUpdates[i] = lastUpdateTime[trackingNumbers[i]];

                StatusUpdate[] memory history = trackingHistory[trackingNumbers[i]];
                locations[i] = history[history.length - 1].location;
            }
        }

        return (statuses, lastUpdates, locations);
    }

    /**
     * @dev Generate emergency alert for delivery issues
     */
    function generateEmergencyAlert(
        string memory trackingNumber,
        string memory reason
    ) external onlyAuthorizedWorker validTrackingNumber(trackingNumber) {
        require(bytes(reason).length > 0, "Reason cannot be empty");

        emit EmergencyAlert(trackingNumber, reason, block.timestamp, msg.sender);
    }

    /**
     * @dev Get all authorized workers
     */
    function getAuthorizedWorkers() external view returns (address[] memory) {
        uint256 activeCount = 0;

        // Count active workers
        for (uint256 i = 0; i < authorizedWorkers.length; i++) {
            if (workers[authorizedWorkers[i]].isAuthorized) {
                activeCount++;
            }
        }

        address[] memory activeWorkers = new address[](activeCount);
        uint256 index = 0;

        // Add active workers to array
        for (uint256 i = 0; i < authorizedWorkers.length; i++) {
            if (workers[authorizedWorkers[i]].isAuthorized) {
                activeWorkers[index] = authorizedWorkers[i];
                index++;
            }
        }

        return activeWorkers;
    }

    /**
     * @dev Verify time proof hash
     */
    function verifyTimeProof(
        string memory trackingNumber,
        uint256 updateIndex,
        bytes32 expectedHash
    ) external view validTrackingNumber(trackingNumber) returns (bool) {
        StatusUpdate[] memory history = trackingHistory[trackingNumber];
        require(updateIndex < history.length, "Update index out of bounds");

        return history[updateIndex].timeProofHash == expectedHash;
    }
}

contracts/MailRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

/**
 * @title MailRegistry
 * @dev Manages mail registration, tracking, and metadata
 */
contract MailRegistry is Ownable, ReentrancyGuard {

    enum MailType { DOCUMENT, PACKAGE, CERTIFIED, PRIORITY }
    enum Priority { STANDARD, PRIORITY, EXPRESS }
    enum MailStatus { REGISTERED, COLLECTED, IN_TRANSIT, OUT_FOR_DELIVERY, DELIVERED, EXCEPTION }

    struct MailMetadata {
        string weight;
        string size;
        Priority priority;
        uint256 insurance; // in wei
        bool requiresSignature;
    }

    struct MailItem {
        string mailId;
        string trackingNumber;
        address senderAddress;
        string recipientId;
        MailType mailType;
        uint256 registrationTime;
        uint256 guaranteedDeliveryTime;
        bool proofOfTimeRequired;
        MailMetadata metadata;
        MailStatus currentStatus;
        uint256 deliveryTime;
        bool isActive;
        bytes32 proofOfTimeHash;
    }

    mapping(string => MailItem) public mailItems;
    mapping(string => string) public trackingToMailId;
    mapping(address => string[]) public senderMails;
    mapping(string => bool) public mailExists;

    string[] public allMailIds;
    uint256 public totalMails;

    event MailRegistered(
        string indexed mailId,
        string trackingNumber,
        address indexed senderAddress,
        string recipientId,
        uint256 registrationTime,
        uint256 guaranteedDeliveryTime
    );

    event MailStatusUpdated(
        string indexed mailId,
        MailStatus previousStatus,
        MailStatus newStatus,
        uint256 timestamp
    );

    event MailDelivered(
        string indexed mailId,
        uint256 deliveryTime,
        uint256 guaranteedTime,
        bool onTime
    );

    event ProofOfTimeGenerated(
        string indexed mailId,
        bytes32 proofHash,
        uint256 timestamp
    );

    modifier mailExistsModifier(string memory mailId) {
        require(mailExists[mailId], "Mail item does not exist");
        _;
    }

    modifier onlySender(string memory mailId) {
        require(mailItems[mailId].senderAddress == msg.sender, "Only sender can perform this action");
        _;
    }

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Register a new mail item
     */
    function registerMail(
        string memory mailId,
        string memory trackingNumber,
        address senderAddress,
        string memory recipientId,
        MailType mailType,
        uint256 guaranteedDeliveryTime,
        bool proofOfTimeRequired,
        MailMetadata memory metadata
    ) external nonReentrant returns (bytes32) {
        require(!mailExists[mailId], "Mail ID already exists");
        require(bytes(trackingNumber).length > 0, "Tracking number cannot be empty");
        require(senderAddress != address(0), "Invalid sender address");
        require(bytes(recipientId).length > 0, "Recipient ID cannot be empty");
        require(guaranteedDeliveryTime > block.timestamp, "Guaranteed delivery time must be in the future");

        bytes32 proofHash = keccak256(abi.encodePacked(
            mailId,
            trackingNumber,
            senderAddress,
            block.timestamp,
            block.number
        ));

        mailItems[mailId] = MailItem({
            mailId: mailId,
            trackingNumber: trackingNumber,
            senderAddress: senderAddress,
            recipientId: recipientId,
            mailType: mailType,
            registrationTime: block.timestamp,
            guaranteedDeliveryTime: guaranteedDeliveryTime,
            proofOfTimeRequired: proofOfTimeRequired,
            metadata: metadata,
            currentStatus: MailStatus.REGISTERED,
            deliveryTime: 0,
            isActive: true,
            proofOfTimeHash: proofHash
        });

        trackingToMailId[trackingNumber] = mailId;
        senderMails[senderAddress].push(mailId);
        mailExists[mailId] = true;
        allMailIds.push(mailId);
        totalMails++;

        emit MailRegistered(
            mailId,
            trackingNumber,
            senderAddress,
            recipientId,
            block.timestamp,
            guaranteedDeliveryTime
        );

        emit ProofOfTimeGenerated(mailId, proofHash, block.timestamp);

        return proofHash;
    }

    /**
     * @dev Update mail status
     */
    function updateMailStatus(
        string memory mailId,
        MailStatus newStatus
    ) external mailExistsModifier(mailId) {
        MailItem storage mail = mailItems[mailId];
        MailStatus previousStatus = mail.currentStatus;

        require(newStatus != previousStatus, "Status must be different");
        require(mail.isActive, "Mail item is not active");

        mail.currentStatus = newStatus;

        // If delivered, record delivery time
        if (newStatus == MailStatus.DELIVERED && mail.deliveryTime == 0) {
            mail.deliveryTime = block.timestamp;

            bool onTime = block.timestamp <= mail.guaranteedDeliveryTime;

            emit MailDelivered(
                mailId,
                block.timestamp,
                mail.guaranteedDeliveryTime,
                onTime
            );
        }

        emit MailStatusUpdated(mailId, previousStatus, newStatus, block.timestamp);
    }

    /**
     * @dev Get mail details by mail ID
     */
    function getMailDetails(string memory mailId) external view mailExistsModifier(mailId) returns (
        string memory trackingNumber,
        address senderAddress,
        string memory recipientId,
        MailType mailType,
        MailStatus currentStatus,
        uint256 registrationTime,
        uint256 deliveryTime,
        uint256 guaranteedDeliveryTime,
        bool proofOfTimeRequired,
        bytes32 proofOfTimeHash
    ) {
        MailItem memory mail = mailItems[mailId];
        return (
            mail.trackingNumber,
            mail.senderAddress,
            mail.recipientId,
            mail.mailType,
            mail.currentStatus,
            mail.registrationTime,
            mail.deliveryTime,
            mail.guaranteedDeliveryTime,
            mail.proofOfTimeRequired,
            mail.proofOfTimeHash
        );
    }

    /**
     * @dev Get mail details by tracking number
     */
    function getMailByTracking(string memory trackingNumber) external view returns (
        string memory mailId,
        address senderAddress,
        string memory recipientId,
        MailStatus currentStatus,
        uint256 registrationTime,
        uint256 guaranteedDeliveryTime
    ) {
        string memory id = trackingToMailId[trackingNumber];
        require(mailExists[id], "Tracking number not found");

        MailItem memory mail = mailItems[id];
        return (
            id,
            mail.senderAddress,
            mail.recipientId,
            mail.currentStatus,
            mail.registrationTime,
            mail.guaranteedDeliveryTime
        );
    }

    /**
     * @dev Get all mail IDs for a sender
     */
    function getSenderMails(address sender) external view returns (string[] memory) {
        return senderMails[sender];
    }

    /**
     * @dev Get mail metadata
     */
    function getMailMetadata(string memory mailId) external view mailExistsModifier(mailId) returns (
        string memory weight,
        string memory size,
        Priority priority,
        uint256 insurance,
        bool requiresSignature
    ) {
        MailMetadata memory metadata = mailItems[mailId].metadata;
        return (
            metadata.weight,
            metadata.size,
            metadata.priority,
            metadata.insurance,
            metadata.requiresSignature
        );
    }

    /**
     * @dev Check if delivery was on time
     */
    function isDeliveredOnTime(string memory mailId) external view mailExistsModifier(mailId) returns (bool) {
        MailItem memory mail = mailItems[mailId];
        require(mail.currentStatus == MailStatus.DELIVERED, "Mail not delivered yet");

        return mail.deliveryTime <= mail.guaranteedDeliveryTime;
    }

    /**
     * @dev Get bulk status for multiple mail IDs
     */
    function getBulkStatus(string[] memory mailIds) external view returns (
        MailStatus[] memory statuses,
        bool[] memory onTimeStatus,
        bytes32[] memory proofHashes
    ) {
        uint256 length = mailIds.length;
        statuses = new MailStatus[](length);
        onTimeStatus = new bool[](length);
        proofHashes = new bytes32[](length);

        for (uint256 i = 0; i < length; i++) {
            if (mailExists[mailIds[i]]) {
                MailItem memory mail = mailItems[mailIds[i]];
                statuses[i] = mail.currentStatus;

                if (mail.currentStatus == MailStatus.DELIVERED) {
                    onTimeStatus[i] = mail.deliveryTime <= mail.guaranteedDeliveryTime;
                } else {
                    onTimeStatus[i] = block.timestamp <= mail.guaranteedDeliveryTime;
                }

                proofHashes[i] = mail.proofOfTimeHash;
            }
        }

        return (statuses, onTimeStatus, proofHashes);
    }

    /**
     * @dev Set guaranteed delivery time (only sender)
     */
    function setGuaranteedDeliveryTime(
        string memory mailId,
        uint256 newGuaranteedTime
    ) external mailExistsModifier(mailId) onlySender(mailId) {
        require(newGuaranteedTime > block.timestamp, "Time must be in the future");
        require(mailItems[mailId].currentStatus != MailStatus.DELIVERED, "Cannot change time for delivered mail");

        mailItems[mailId].guaranteedDeliveryTime = newGuaranteedTime;
    }

    /**
     * @dev Get total number of mails
     */
    function getTotalMails() external view returns (uint256) {
        return totalMails;
    }

    /**
     * @dev Get all mail IDs (paginated)
     */
    function getAllMailIds(uint256 offset, uint256 limit) external view returns (string[] memory) {
        require(offset < allMailIds.length, "Offset out of bounds");

        uint256 end = offset + limit;
        if (end > allMailIds.length) {
            end = allMailIds.length;
        }

        string[] memory result = new string[](end - offset);
        for (uint256 i = offset; i < end; i++) {
            result[i - offset] = allMailIds[i];
        }

        return result;
    }
}

contracts/TimeProof.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "@openzeppelin/contracts/utils/cryptography/MessageHashUtils.sol";

/**
 * @title TimeProof
 * @dev Generates and verifies cryptographic proofs of specific timestamps
 */
contract TimeProof is Ownable, ReentrancyGuard {
    using ECDSA for bytes32;
    using MessageHashUtils for bytes32;

    enum EventType { 
        REGISTRATION, 
        PICKUP, 
        DELIVERY_CONFIRMATION, 
        DISPUTE 
    }

    struct TimeProofData {
        string mailId;
        EventType eventType;
        uint256 timestamp;
        bytes32 blockHash;
        uint256 blockNumber;
        uint256 transactionIndex;
        bytes32[] merkleProof;
        bytes atomicTimeSignature;
        string ntpServerUsed;
        bytes32[] certificateChain;
        address requestedBy;
        bool isVerified;
        uint256 creationTime;
    }

    struct AtomicTimeData {
        uint256 timestamp;
        string ntpServer;
        bytes signature;
        address timestampAuthority;
    }

    mapping(bytes32 => TimeProofData) public timeProofs;
    mapping(string => bytes32[]) public mailTimeProofs;
    mapping(address => bool) public authorizedTimestampAuthorities;
    mapping(bytes32 => bool) public usedNonces;

    bytes32[] public allProofHashes;
    uint256 public totalProofs;

    event TimeProofGenerated(
        bytes32 indexed proofHash,
        string indexed mailId,
        EventType eventType,
        uint256 timestamp,
        address requestedBy
    );

    event TimeProofVerified(
        bytes32 indexed proofHash,
        bool isValid,
        uint256 verificationTime,
        address verifiedBy
    );

    event TimestampAuthorityAdded(address indexed authority, uint256 timestamp);
    event TimestampAuthorityRemoved(address indexed authority, uint256 timestamp);

    modifier onlyAuthorizedAuthority() {
        require(authorizedTimestampAuthorities[msg.sender], "Not an authorized timestamp authority");
        _;
    }

    modifier validMailId(string memory mailId) {
        require(bytes(mailId).length > 0, "Invalid mail ID");
        _;
    }

    modifier proofExists(bytes32 proofHash) {
        require(timeProofs[proofHash].timestamp != 0, "Time proof does not exist");
        _;
    }

    constructor() Ownable(msg.sender) {
        // Add owner as default timestamp authority
        authorizedTimestampAuthorities[msg.sender] = true;
        emit TimestampAuthorityAdded(msg.sender, block.timestamp);
    }

    /**
     * @dev Add authorized timestamp authority
     */
    function addTimestampAuthority(address authority) external onlyOwner {
        require(authority != address(0), "Invalid authority address");
        require(!authorizedTimestampAuthorities[authority], "Authority already authorized");

        authorizedTimestampAuthorities[authority] = true;

        emit TimestampAuthorityAdded(authority, block.timestamp);
    }

    /**
     * @dev Remove timestamp authority
     */
    function removeTimestampAuthority(address authority) external onlyOwner {
        require(authorizedTimestampAuthorities[authority], "Authority not authorized");
        require(authority != owner(), "Cannot remove contract owner");

        authorizedTimestampAuthorities[authority] = false;

        emit TimestampAuthorityRemoved(authority, block.timestamp);
    }

    /**
     * @dev Generate a time proof for a specific mail event
     */
    function generateTimeProof(
        string memory mailId,
        EventType eventType,
        address requestedBy,
        AtomicTimeData memory atomicTime,
        bytes32[] memory certificateChain,
        bytes32 nonce
    ) external onlyAuthorizedAuthority validMailId(mailId) nonReentrant returns (bytes32) {
        require(requestedBy != address(0), "Invalid requester address");
        require(!usedNonces[nonce], "Nonce already used");
        require(atomicTime.timestamp <= block.timestamp + 300, "Atomic time too far in future"); // 5 min tolerance
        require(atomicTime.timestamp >= block.timestamp - 300, "Atomic time too far in past");
        require(certificateChain.length > 0, "Certificate chain cannot be empty");

        usedNonces[nonce] = true;

        // Generate merkle proof elements (simplified for demo)
        bytes32[] memory merkleProof = new bytes32[](3);
        merkleProof[0] = keccak256(abi.encodePacked(mailId, eventType));
        merkleProof[1] = keccak256(abi.encodePacked(block.timestamp, block.number));
        merkleProof[2] = keccak256(abi.encodePacked(requestedBy, atomicTime.timestamp));

        bytes32 proofHash = keccak256(abi.encodePacked(
            mailId,
            uint256(eventType),
            block.timestamp,
            block.number,
            requestedBy,
            atomicTime.timestamp,
            atomicTime.ntpServer,
            nonce
        ));

        TimeProofData memory proof = TimeProofData({
            mailId: mailId,
            eventType: eventType,
            timestamp: block.timestamp,
            blockHash: blockhash(block.number - 1),
            blockNumber: block.number,
            transactionIndex: 0, // Would be set by indexer in real implementation
            merkleProof: merkleProof,
            atomicTimeSignature: atomicTime.signature,
            ntpServerUsed: atomicTime.ntpServer,
            certificateChain: certificateChain,
            requestedBy: requestedBy,
            isVerified: false,
            creationTime: block.timestamp
        });

        timeProofs[proofHash] = proof;
        mailTimeProofs[mailId].push(proofHash);
        allProofHashes.push(proofHash);
        totalProofs++;

        emit TimeProofGenerated(
            proofHash,
            mailId,
            eventType,
            block.timestamp,
            requestedBy
        );

        return proofHash;
    }

    /**
     * @dev Verify a time proof
     */
    function verifyTimeProof(bytes32 proofHash) external proofExists(proofHash) returns (bool) {
        TimeProofData storage proof = timeProofs[proofHash];

        // Verify blockchain data
        bool blockchainValid = proof.blockNumber > 0 && proof.blockNumber <= block.number;

        // Verify merkle proof (simplified verification)
        bool merkleValid = proof.merkleProof.length > 0;

        // Verify atomic time signature (simplified - would verify against NTP authority in real implementation)
        bool atomicTimeValid = proof.atomicTimeSignature.length > 0;

        // Verify certificate chain (simplified)
        bool certificateValid = proof.certificateChain.length > 0;

        bool isValid = blockchainValid && merkleValid && atomicTimeValid && certificateValid;

        proof.isVerified = isValid;

        emit TimeProofVerified(proofHash, isValid, block.timestamp, msg.sender);

        return isValid;
    }

    /**
     * @dev Get time proof details
     */
    function getTimeProof(bytes32 proofHash) external view proofExists(proofHash) returns (
        string memory mailId,
        EventType eventType,
        uint256 timestamp,
        bytes32 blockHash,
        uint256 blockNumber,
        string memory ntpServerUsed,
        address requestedBy,
        bool isVerified,
        uint256 creationTime
    ) {
        TimeProofData memory proof = timeProofs[proofHash];
        return (
            proof.mailId,
            proof.eventType,
            proof.timestamp,
            proof.blockHash,
            proof.blockNumber,
            proof.ntpServerUsed,
            proof.requestedBy,
            proof.isVerified,
            proof.creationTime
        );
    }

    /**
     * @dev Get all time proof hashes for a mail item
     */
    function getMailTimeProofs(string memory mailId) external view validMailId(mailId) returns (bytes32[] memory) {
        return mailTimeProofs[mailId];
    }

    /**
     * @dev Get merkle proof for verification
     */
    function getMerkleProof(bytes32 proofHash) external view proofExists(proofHash) returns (bytes32[] memory) {
        return timeProofs[proofHash].merkleProof;
    }

    /**
     * @dev Get certificate chain for a proof
     */
    function getCertificateChain(bytes32 proofHash) external view proofExists(proofHash) returns (bytes32[] memory) {
        return timeProofs[proofHash].certificateChain;
    }

    /**
     * @dev Batch verify multiple time proofs
     */
    function batchVerifyTimeProofs(bytes32[] memory proofHashes) external returns (bool[] memory) {
        uint256 length = proofHashes.length;
        bool[] memory results = new bool[](length);

        for (uint256 i = 0; i < length; i++) {
            if (timeProofs[proofHashes[i]].timestamp != 0) {
                results[i] = this.verifyTimeProof(proofHashes[i]);
            } else {
                results[i] = false;
            }
        }

        return results;
    }

    /**
     * @dev Get verification status of a proof
     */
    function getVerificationStatus(bytes32 proofHash) external view proofExists(proofHash) returns (
        bool isVerified,
        bool blockchainConfirmed,
        bool atomicTimeVerified,
        bool merkleProofValid
    ) {
        TimeProofData memory proof = timeProofs[proofHash];

        return (
            proof.isVerified,
            proof.blockNumber > 0 && proof.blockNumber <= block.number,
            proof.atomicTimeSignature.length > 0,
            proof.merkleProof.length > 0
        );
    }

    /**
     * @dev Generate simple time proof without external atomic time (for testing)
     */
    function generateSimpleTimeProof(
        string memory mailId,
        EventType eventType,
        address requestedBy
    ) external validMailId(mailId) returns (bytes32) {
        bytes32 nonce = keccak256(abi.encodePacked(block.timestamp, block.prevrandao, msg.sender));
        require(!usedNonces[nonce], "Nonce collision");

        AtomicTimeData memory atomicTime = AtomicTimeData({
            timestamp: block.timestamp,
            ntpServer: "internal",
            signature: abi.encodePacked(block.timestamp),
            timestampAuthority: msg.sender
        });

        bytes32[] memory certificateChain = new bytes32[](1);
        certificateChain[0] = keccak256(abi.encodePacked("internal_certificate", block.timestamp));

        return this.generateTimeProof(
            mailId,
            eventType,
            requestedBy,
            atomicTime,
            certificateChain,
            nonce
        );
    }

    /**
     * @dev Get total number of proofs
     */
    function getTotalProofs() external view returns (uint256) {
        return totalProofs;
    }

    /**
     * @dev Get all proof hashes (paginated)
     */
    function getAllProofHashes(uint256 offset, uint256 limit) external view returns (bytes32[] memory) {
        require(offset < allProofHashes.length, "Offset out of bounds");

        uint256 end = offset + limit;
        if (end > allProofHashes.length) {
            end = allProofHashes.length;
        }

        bytes32[] memory result = new bytes32[](end - offset);
        for (uint256 i = offset; i < end; i++) {
            result[i - offset] = allProofHashes[i];
        }

        return result;
    }
}

